import React from 'react';

class About extends React.Component {
    render() {
        return (
            <h1 style={headingStyle}>About</h1>
        );
    }
}

const headingStyle = {
    textAlign: 'center',
    backgroundColor: "black",
    color: '#FFFBFF',
    padding: '0.8em'
};

export default About;
